        <div>
            <h1>'Admin' page to add the shoes to the DB</h1>
            <h3>Shoes info</h3>
            <Input type="number" min="4" max="12" placeholder="Drop" name="drop" />
            <Input type="number" placeholder="peso"  name="peso" />
            <Input type="number" min="1" max="3" name="Maciez" placeholder="Maciez" />
            <Input type="number" min="1" max="3" name="Treino" placeholder="Tipo de treino" />
            <button onClick={addItemToDb('1', '2', 3, 4)}></button>
        </div>
    )
}




